B.Es=A.a(s(["\u0130htiyats\u0131z, co\u015fkulu ve dik kafal\u0131 olan siz Ko\xe7 kad\u0131nlar\u0131 i\xe7in ya\u015fam g\xf6r\xfcnd\xfc\u011f\xfc kadar kolay de\u011fildir. Tutkulu ve idealist yap\u0131n\u0131z\u0131 her zaman vurgulayacak bir ya\u015fam bi\xe7imini benimserken, himayeci ve korumac\u0131 i\xe7g\xfcd\xfcn\xfcz\xfc \xf6n plana \xe7\u0131karan bir e\u015f arar, size kafa tutacak bir sevgilinin \xf6zlemini duyars\u0131n\u0131z. \u0130li\u015fkilerinizde son derece k\u0131skan\xe7 bir yap\u0131 sergilersiniz.Tutkular\u0131n\u0131z derin, hisleriniz i\xe7tendir. Erke\u011finizin iyi ve k\xf6t\xfc g\xfcn\xfcnde daima yan\u0131nda olu\u015funuz, sizi ideal bir i\u015f yapar.Ya\u015fam\u0131n\u0131zda \xe7ocuklar\u0131n\u0131z\u0131n \xf6nemi \xe7ok b\xfcy\xfckt\xfcr. Onlarla iyi ge\xe7inir ve onlara b\xfcy\xfcl\xfc bir d\xfcnya yarat\u0131rs\u0131n\u0131z. Di\u011fer annelere g\xf6re tek fark\u0131n\u0131z, her a\u011flad\u0131klar\u0131nda ko\u015fup kuca\u011f\u0131n\u0131za almayacak kadar onlar\u0131 onurlu bir ki\u015filik kazand\u0131rma sava\u015f\u0131 vermenizdir.","\xc7ok g\xfc\xe7l\xfc bir fiziksel yap\u0131ya sahip olduklar\u0131 i\xe7in, a\u015fkta da a\u015f\u0131r\u0131l\u0131klara ka\xe7abilirler.z. Ger\xe7ek sevgiyi ararken, yanl\u0131\u015f evliliklere s\xfcr\xfcklenebilirler.. Sessiz, sakin yap\u0131n\u0131za ra\u011fmen, derin ve yo\u011fun duygulara sahiptirler.. Ses tonlar\u0131 m\xfckemmeldirler. Sanata kar\u015f\u0131 e\u011filimlerini engelleyemezler. G\xfczelli\u011fe ve uyuma olan tutkular\u0131n\u0131 herkes anlayamaz. Her \u015feyden \u015fikayet eden kad\u0131nlardan olmad\u0131klar\u0131 i\xe7in de, \xe7o\u011fu kez gere\u011finden fazla sorumluluk al\u0131rlar.. Annelik ve e\u015f olmak onlara \xe7ok yak\u0131\u015f\u0131r. Hi\xe7 bu kadar eviyle b\xfct\xfcnle\u015fen bir ki\u015fi g\xf6remezsiniz. Sakin ve di\u015fi yap\u0131lar\u0131yla \xe7ocuklar\u0131n\u0131 ve sevdiklerini \xe7ok g\xfczel ta\u015f\u0131r ve hi\xe7 de \u015fikayet etmezler.. \xc7ocuklar\u0131 daha k\xfc\xe7\xfck ya\u015fta disiplinli ve derli toplu olmay\u0131 \xf6\u011frenmi\u015flerdir ve \xf6m\xfcr boyu annalerine minnettar kal\u0131caklard\u0131r. Mutfak malzemelerine kar\u015f\u0131 zaaflar\u0131 \xe7ok fazlad\u0131r. G\xfcn\xfcn uzun bir zaman\u0131n\u0131 mutfakta ge\xe7irebilirler.","\u0130kizler kad\u0131n\u0131 i\xe7in mant\u0131k \xe7ok \xf6nemlidir. Duygulardan \xf6nce mant\u0131\u011f\u0131n geli\u015fmesini bekler.Her \u015feyi dengede tutmaktan ho\u015flan\u0131r. De\u011fi\u015fkenli\u011fi size ula\u015f\u0131lmaz gibi gelebilir. E\u011fer bu bur\xe7tan biri ile beraber olacaks\u0131n\u0131z, Onun de\u011fi\u015fimlerine haz\u0131r olmal\u0131s\u0131n\u0131z. Genelde ilgisiz ula\u015f\u0131lmaz ve zor g\xf6r\xfcn\xfcrler. Siz nerde hata yapt\u0131\u011f\u0131n\u0131z\u0131 d\xfc\u015f\xfcn\xfcrken, o sizin tak\u0131nt\u0131lar\u0131n\u0131z\u0131 anlamak bile istemez. E\u011fer siz, rutin ve tansiyonu d\xfc\u015f\xfck bir ili\u015fki hayal ediyorsan\u0131z, kesinlikle \u0130kizler kad\u0131n\u0131ndan uzak kalmal\u0131s\u0131n\u0131z. Hele kaybetmeye al\u0131\u015fk\u0131n de\u011filseniz, ona sak\u0131n yakla\u015fmay\u0131n. Belle\u011fi de g\xfc\xe7l\xfc say\u0131lmaz. Her\xackesi heyecanland\u0131ran bir tart\u0131\u015fma esnas\u0131nda birden sa\xe7\u0131\xacn\u0131z\u0131n yanl\u0131\u015f yerden ayr\u0131lm\u0131\u015f oldu\u011funa veya yeni kaza\u011f\u0131\xacn\u0131z\u0131n yerdeki hal\u0131ya uymad\u0131\u011f\u0131na karar verebilir. Duygu-lar bak\u0131m\u0131ndan o da erkek \u0130kizlere benzer. Fl\xf6rt\xe7\xfc iz\xaclenimi b\u0131rak\u0131r ve sevgilisini de \xe7ok \xfczer. Erkekler onu havai ve ne yapaca\u011f\u0131 bilinmez, biri olarak g\xf6r\xfcr ama yine de be\u011fenirler. Bu kad\u0131nla ili\u015fki kurmay\u0131 isteyen kimse kar\u015f\u0131s\u0131nda bir harem oldu\u011funu bilmelidir. Y\u0131l\u0131n her g\xfcn\xfc ba\u015fka bir kad\u0131nd\u0131r o. Bu kad\u0131n\u0131 be\u011fenip be\u011fenmemeniz de ona ayak uydurup uyduramaman\u0131za ba\u011fl\u0131d\u0131r tabii. \u0130kizler kad\u0131n\u0131 da, burcun erke\u011fi gibi pek pratik biri de\u011fildir. Onun i\xe7in kendisini \xe7ekip \xe7evirecek birine ih\xactiyac\u0131 vard\u0131r. Ancak bunu belli etmeden yapmak gere\xackir. Zaten bu kad\u0131n\u0131n durulup oturmas\u0131n\u0131 yahut a\u015fk\u0131 ciddiye almas\u0131n\u0131 sa\u011flamak yeteri kadar g\xfc\xe7t\xfcr. Bu ka\xacd\u0131n\u0131n sa\u011fl\u0131\u011f\u0131yla da ilgilenmek gerekir. Onun temiz hava, egzersiz ve uygun besinlere gereksinmesi vard\u0131r","Ya\u015fam\u0131n sakin bir liman\u0131 olan Yenge\xe7ler, karma\u015f\u0131k duygulara kap\u0131ld\u0131\u011f\u0131 zaman onlar\u0131 tan\u0131mak g\xfc\xe7le\u015fir.Sevgi dolu \u015fefkatli, bir o kadar ihtirasl\u0131 yap\u0131lar\u0131 ile onu tan\u0131man\u0131z her zaman m\xfcmk\xfcn olmayabilir. K\u0131r\u0131lmaktan \xe7ok korkarlar. Partnerlerine kalplerinin kap\u0131lar\u0131n\u0131 a\xe7makta zorlan\u0131rlar.Ge\xe7mi\u015ften kolayca kopmad\u0131klar\u0131 i\xe7in an\u0131lar\u0131n ya\u015fant\u0131lar\u0131nda yeri \xe7ok fazlad\u0131r ve kimsenin ge\xe7mi\u015fleri i\xe7in, k\xf6t\xfc bir s\xf6z s\xf6ylemelerine izin vermezler.Bu ana\xe7 kad\u0131n, kendisine kol kanat geren g\xfc\xe7l\xfc bir erkek arar.Fakat ona h\xfckmeden erkeklerden ho\u015flanmaz.Onun de\u011fi\u015fen duygusalll\u0131klar\u0131na ayak uyduracak bir partnere ihtiya\xe7 duyarlar. Macera ya\u015fanacak bir kad\u0131n de\u011fildir.Aldat\u0131lmaya hi\xe7 gelemez. E\u011fer evcil bir yap\u0131ya sahipseniz bir Yenge\xe7 \xf6m\xfcr boyu sizi mutlu edecektir. Rahat\xe7a sizi kucaklamas\u0131na izin verin.","Son derece sad\u0131k, c\xf6mert ve y\xfcce g\xf6n\xfcll\xfc olmalar\u0131na ra\u011fmen, evlilikte her zaman \u015fansl\u0131 say\u0131lmazlar. Hatta ili\u015fkileri tuhaf bir \u015fekilde biter. Ya\u015famlar\u0131nda \xe7o\u011fu kez \xe7ocuklar\u0131yla sorunlar\u0131 olur. ve bu da evliliklerinin g\xf6lgelenmesine neden olabilir. Gen\xe7lik y\u0131llar\u0131nda acemi a\u015fklar\u0131n avc\u0131s\u0131yken, ya\u015f\u0131n\u0131z ilerledik\xe7e olgun a\u015fklar\u0131n g\xf6rkemli yarat\u0131c\u0131s\u0131 olur ve yaln\u0131z bir ya\u015fam\u0131 asla d\xfc\u015f\xfcnemez.. Duygulu romatik bile olsa, l\xfcks ya\u015fam arzusundan asla vazge\xe7emez. Hayat\u0131nda daima ona e\u015flik edecek a\u015fklar vard\u0131r. Se\xe7imleri isabetli ve uygun ki\u015filer olacakt\u0131r. D\xfcr\xfcst oldu\u011fu i\xe7in de, hayat\u0131ndaki ki\u015fiden b\u0131ksa bile onu terk etmeden ya\u015fant\u0131s\u0131na ba\u015fka bir kimseyi almaz.. Aslan kad\u0131nlar\u0131 gece hayat\u0131ndan ve g\xf6rkemden ho\u015flan\u0131r. Siz de, her konuda bu \xf6zelli\u011fkerini yans\u0131tan k\u0131yafetler ve e\u015fyalardan alman\u0131z\u0131 isteyebilir. Tak\u0131lar\u0131n da ya\u015fant\u0131lar\u0131nda \xf6nemli bir yer tuttu\u011funu unutmay\u0131n.Bu kad\u0131n sayg\u0131 duydu\u011fu bir e\u015fi oldu\u011fu zaman ya\u015fant\u0131s\u0131ndaki ki\u015fiyide mutlu edecektir.","Garip bir do\u011falar\u0131 vard\u0131r. Az veya \xe7ok, kendilerine yeten tav\u0131rlar\u0131yla evlili\u011fe her zaman tepkilidirler.. Se\xe7ici ve ele\u015ftirici tutumlar\u0131yla, a\u015fk\u0131 s\xfcrekli kendilerinden s\xfcrekli uzakla\u015ft\u0131r\u0131rlar. Hele evlili\u011fi hi\xe7 yakla\u015ft\u0131rmazken, ili\u015fkilerinde bencilliklerini ortaya koyarlar.. E\u011fer; bir g\xfcn ger\xe7ekten evlenmeyi isterlerse, ili\u015fkilerini sayg\u0131 ve mant\u0131k \xe7er\xe7evesinde y\xfcr\xfct\xfcrlerdir.. M\xfckemmelli\u011fi arayan bir ki\u015fi olarak, se\xe7tikleri e\u015f onlar\u0131 fazlas\u0131yla hak ederler.. Onlar da bunun fark\u0131ndad\u0131r. Bu evlilikte, asla ayr\u0131l\u0131\u011fa yer olmayacakt\u0131r. Kusursuz bir anne \xf6rne\u011fi olduklar\u0131 i\xe7in, \xe7ocuklar\u0131n\u0131nda her konuda m\xfckemmel olmas\u0131n\u0131 isterler.. Ev ve i\u015f ya\u015fam\u0131 ayn\u0131 derecede \xf6nemli oldu\u011fundan, her ikisini de ba\u015far\u0131l\u0131 bir \u015fekilde g\xf6t\xfcr\xfcrs\xfcn\xfcz. \xc7ocuklar\u0131yla terbiyeli ve s\xf6z dinleyen \xe7ocuklar olacak ve sayg\u0131l\u0131 bir \u015fekilde ili\u015fkileriniz y\xfcr\xfcteceklerdir.. Klasik ve sade zevkleri vard\u0131r. Hedeflerini iyi se\xe7erler. Ba\u015far\u0131 i\xe7in hi\xe7bir engel tan\u0131mazlar.. Tarafs\u0131z gibi g\xf6r\xfcnseler de, taraf tutarlar. Tutkulu fakat kinci de\u011fildirler.. Duygu ve mant\u0131\u011f\u0131 aras\u0131nda m\xfcthi\u015f bir denge yetene\u011fi vard\u0131r.. \u0130li\u015fkilerinde \xe7ok severse taviz verirler.. Tenkit edilmeye gelemezler.","Terazi burcu kad\u0131nlar\u0131n\u0131n \xe7o\u011fu, kar\u015f\u0131lar\u0131na en ufak bir fikir tart\u0131\u015fmas\u0131 olana\u011f\u0131 \xe7\u0131kt\u0131\u011f\u0131 zaman, keskin zekalar\u0131n\u0131 g\xf6stereceklerdir.Teraziyle tart\u0131\u015fmaya girmek istemezseniz, o kendi kendiyle tart\u0131\u015facakt\u0131r. Bir terazi k\u0131z\u0131 tek ba\u015f\u0131na kavgay\u0131 ba\u015flatabilir ve b\xfcy\xfck bir zevkle s\xfcrd\xfcrebilir ve yine kendisi sonu\xe7land\u0131rabilir. Ona g\xf6re her \u015fey sonunda e\u015fitlenir. O daima hakl\u0131d\u0131r ve sonunda son kararlar\u0131 o verecektir.Terazi kad\u0131n\u0131 adil de\u011filse, d\xfcnyada hi\xe7bir \u015fey e\u015fit de\u011fildir. Onun \xe7ekicili\u011fi ve dayan\u0131lmaz tebess\xfcm\xfc di\u011fer kad\u0131nlardan \xe7ok farkl\u0131d\u0131r. A\xe7\u0131k ve berrak bir mant\u0131kla sizi daima kendine inand\u0131racakt\u0131r. O bir Ven\xfcs k\u0131z\u0131d\u0131r. Hayat\u0131 g\xfczel ve zevkli ya\u015famak, ve sat\u0131n alabilece\u011fi t\xfcm g\xfczel \u015feyleri ister. Onlar\u0131n b\xfcy\xfck paralara ihtiya\xe7lar\u0131 vard\u0131r. L\xfcks\xfc, pahal\u0131 giysileri, parf\xfcmleri ve kendini g\xfczel hissettirecek e\u015fyalara sahip olmak isterler. Bir terazi kad\u0131n\u0131 asla a\u015fks\u0131z ya\u015fayamaz. Gerek i\u015f hayat\u0131nda, gerek \xf6zel ya\u015fam\u0131nda daima romantik bir ili\u015fkiye ihtiya\xe7 duyar. \xd6zellikle sevece\u011fi bir erke\u011fin \xf6zlemini \xe7eker. Terazi kad\u0131n\u0131n hakk\u0131n\u0131 vermek zorundas\u0131n\u0131z. O Zodyak\u2019\u0131n herkese nasip olmayacak \xf6zel bir di\u015fisidir. Zaman zaman, dengelerini kaybedebilir. \xc7\xfcnk\xfc, duygusal d\xfcnyas\u0131 daima kar\u0131\u015f\u0131kt\u0131r. \xd6zlemlerini ve isteklerini kar\u015f\u0131layamad\u0131\u011f\u0131 zaman kaprisli y\xf6nleri ortaya \xe7\u0131kar. A\u015fk ormanlar\u0131n\u0131n romantik gezilerine daima ihtiya\xe7 duyarlar. Uygun partner buluncaya kadar, g\xf6n\xfcl kap\u0131lar\u0131n\u0131 daima a\xe7\u0131k tutarlar. Y\xfczleri g\xfczel duru ve sevecendir. Bak\u0131\u015flar\u0131 anlay\u0131\u015f doludur. G\xf6zlerinin i\xe7i g\xfcler. Orant\u0131l\u0131 bir v\xfccuda sahip olmalr\u0131na kar\u015f\u0131n, hafif etine dolgun hatlar\u0131 ya\u015flar\u0131 ilerledik\xe7e hantalla\u015fabilir. Giyim konusunda \xe7ok zevklidirler, cezbedici ve c\xfcretkar giyinmekle beraber, asla baya\u011f\u0131 olmazlar. Ger\xe7ek bir diplomatt\u0131r. Nerede ne yapaca\u011f\u0131n\u0131 bilir. Nezaketi ve inceli\u011fi ona t\xfcm kap\u0131lar\u0131 a\xe7ar. \u0130\u015fleri ne olursa olsun, as\u0131l i\u015fleri ya\u015fam\u0131 ve \xe7evresini g\xfczelle\u015ftirmektir. Hayat\u0131n hep g\xfczel yanlar\u0131n\u0131 g\xf6rmek isterler. Evlili\u011fi dost\xe7a yap\u0131lan bir ortakl\u0131k olarak g\xf6r\xfcrler. Yaln\u0131z kalmaktan hi\xe7 ho\u015flanmazlar. \u0130nsan ili\u015fkilerine \xe7ok \xf6nem verirler.","Siz a\u015f\u0131r\u0131l\u0131klar\u0131n ve a\u015f\u0131r\u0131 u\xe7lar\u0131n insanlar\u0131d\u0131r.. Bu \xf6zelliklerini bildikleri i\xe7in, kendileriyle ilgili yorum yapma ihtiyac\u0131 bile duymazlar. . Bir Akrep olarak; asla g\xfc\xe7s\xfcz biriyle evlenmez, ancak \xfcst\xfcn ki\u015filikte birine teslim olurlar. G\xfc\xe7l\xfc karakterleri, ve garip adalet duygular\u0131yla onlar\u0131 anlayabilecekleri bir e\u015f olabilmek de herkesin harc\u0131 de\u011fildir Zevkli ve se\xe7ici zevkleri vard\u0131r. G\xfczellikler hep karanl\u0131klarda gizli oldu\u011fu i\xe7in, imkans\u0131z olan \u015feylerden ho\u015flan\u0131rlar.. S\u0131n\u0131rlar\u0131n\u0131z \xe7ok geni\u015f olup, sevdi\u011finiz \u015feyleri \xf6zel olarak ke\u015ffetmek gerekir.","Yay burcu kad\u0131n\u0131 \xf6ncelikle ger\xe7ekten k\xfclt\xfcrl\xfc bir ki\u015fili\u011fe sahiptir. Bu \xf6zellikleri ile her ortamda, her insan\u0131n dikkatini \xe7ekmeyi ba\u015farabilirler. Espri yetenekleri olduk\xe7a iyidir ve kendisi ne\u015feli oldu\u011fu gibi insanlara da ne\u015fe verirler. Bu nedenle yay burcu kad\u0131n\u0131 sevilen ve aran\u0131lan bir kad\u0131nd\u0131r.","Ya\u015famlar\u0131nda ger\xe7ek a\u015fk\u0131n sadece mant\u0131k s\xfczgecinden ge\xe7ti\u011fine inand\u0131klar\u0131 i\xe7in, isteklerine kavu\u015fmak i\xe7in idealleri i\xe7in ya\u015farlar. \u0130stemeseler de \xf6n yarg\u0131l\u0131 olmaktan kendilerini alamazlar. Birlikte oldu\u011fu ki\u015fi s\xfcrekli m\xfckemmel g\xf6rmek istedikleri i\xe7in, partnerlerini tenkitleriyle ya\u015famlar\u0131ndan bezdirebilirler. Y\xfcksek standartlar\u0131 zamanla kendileriniz de rahats\u0131z eder Ya\u015fam\u0131 ve a\u015fk\u0131 ciddiye alan, ender ki\u015filerdendir. Romantizmde bile ger\xe7eklerden fazla uzakla\u015fmaz ve duygular\u0131n\u0131 herkesten daha ger\xe7ek\xe7i ya\u015farlar G\xfcvendikleri ki\u015filere yard\u0131m etmeyi sevmelerine ra\u011fmen, inanmad\u0131klar\u0131 ve tembel olduklar\u0131n\u0131 bildikleri ki\u015filere kar\u015f\u0131 so\u011fuk davran\u0131rlar. Ya\u015famlar\u0131 boyunca dinlenmeden \xe7al\u0131\u015f\u0131rlar.","\xd6zg\xfcrl\xfckleri i\xe7in sava\u015f verirken en g\xfczel a\u015fklar\u0131 ya\u015far ve evlilik d\xf6neme\xe7lerinden h\u0131zla d\xf6nerken, geride kalanlar\u0131 umursamazlar.. Dost yanl\u0131s\u0131 yap\u0131lar\u0131yla \xe7evreleri \xf6ylesine kalabal\u0131kt\u0131r ki; bazen a\u015fkla dostlu\u011fu birbirine kar\u0131\u015ft\u0131r\u0131r ve en sonunda, onlar\u0131 okul y\u0131llar\u0131ndan tan\u0131yan biri ile s\xfcrpriz bir evlilik yaparlar. Sonu\xe7, genellikle yanl\u0131\u015f bir karar ve bo\u015fanma ile sonu\xe7lanan birliktelik. Yine de bu kadar \xfcmitsiz de\u011fil tabii.. Onlar asl\u0131nda hem de\u011fi\u015fen ve yine de ayn\u0131 kalabilen ender ki\u015filerdir.. Bir Kova kad\u0131n\u0131yla ya\u015famak son derece e\u011flenceli ve hareketlidir. Anne olmay\u0131 pek beceremezler. \xc7ocuklar\u0131na daha k\xfc\xe7\xfck ya\u015flarda b\xfcy\xfck gibi davrand\u0131klar\u0131 i\xe7in, onlar\u0131n yeteneklerini \xe7abuk ke\u015ffeder ve bir abla gibi onlarla ilgilenirler. \xc7ocuklar\u0131 kova annelerini \xe7ok sever ve onlar\u0131n her anlatt\u0131\u011f\u0131 \u015feyi ilgiyle dinlerler. Ya\u015fam\u0131n her t\xfcrl\xfc s\xfcrprizine a\xe7\u0131k ki\u015filerdir. Konu\u015fma tarz\u0131 pratik ve direk olup zaman kaybetmekten ho\u015flanmazlar. \u0130yi bir e\u011fitim alm\u0131\u015f ve bilgisini yerinde kullanan bir ki\u015fili\u011fe sahipse ya\u015fam\u0131 olduk\xe7a keyifli alg\u0131larlar.. Akademik kariyer yapmaya m\xfcsait bir zihin kapasiteleri vard\u0131r. A\u015fk ya\u015fant\u0131s\u0131 kar\u0131\u015f\u0131k fakat isteklerinde sabittirler. G\xfcn\xfcn de\u011fi\u015fen ko\u015fullar\u0131na h\u0131zl\u0131 bir \u015fekilde ge\xe7erler ve zevklerinde de\u011fi\u015fimler onlar\u0131 zorlamaz. Ger\xe7ek dostlar\u0131ndan asla vazge\xe7mezler \xc7ocukluk an\u0131lar\u0131na ba\u011fl\u0131 ve hala baz\u0131 k\xfc\xe7\xfck e\u015fyalar\u0131n\u0131 korumakta \u0131srarc\u0131d\u0131rlar.","Sonsuz a\u015fka ve romantizme inan\u0131r. Hayal g\xfc\xe7leri \xe7ok kuvvetlidir. Hayal k\u0131r\u0131kl\u0131klar\u0131 ya\u015famlar\u0131ndan hi\xe7 eksik olmaz fakat yinede a\u015fk\u0131 aramaktan vazge\xe7mezler. A\u015famad\u0131klar\u0131 kalp a\u011fr\u0131lar\u0131na ra\u011fmen, her yeni a\u015fka umutla bakarlar. Duygular\u0131 s\xfcrekli kar\u0131\u015f\u0131kt\u0131r. G\xfcven aray\u0131\u015f\u0131 i\xe7inde olduklar\u0131 i\xe7in, bazen yanl\u0131\u015f ili\u015fkiler ya\u015famalar\u0131 her \u015feyi yeni ba\u015ftan ba\u015flatmalar\u0131na neden olur. Al\u0131\u015fkanl\u0131klar\u0131n\u0131 k\u0131sa s\xfcrede terk ettikleri i\xe7inde, kalp ac\u0131lar\u0131n\u0131 \xe7abuk unuturlar ve yeniden a\u015f\u0131k olurlar. Evlili\u011fe en yatk\u0131n ve arzulu bur\xe7tur. \xc7oluk \xe7ocu\u011fa kar\u0131\u015fma konusunda acele ederler. Ge\xe7mi\u015ften kolayca kopmad\u0131klar\u0131 i\xe7in, an\u0131lar\u0131n ya\u015fant\u0131lar\u0131nda yeri \xe7ok fazlad\u0131r ve kimsenin ge\xe7mi\u015fleri i\xe7in, k\xf6t\xfc bir s\xf6z s\xf6ylemelerine izin vermezler. D\xfcnyaya g\xf6zlerini a\xe7t\u0131klar\u0131 anda, ge\xe7mi\u015flerine ba\u011fl\u0131 olarak ya\u015farlar Ya\u015famlar\u0131nda anneleri \xe7ok \xf6nemlidir..Duygu ve sezgileri \xe7ok g\xfc\xe7l\xfcd\xfcr ve ideal e\u015flerini g\xf6rd\xfckler anda, onlar\u0131n ya\u015fant\u0131lar\u0131nda \xf6nemli yeri olacaklar\u0131n\u0131 hissederler. Aldatmaktan ve aldanmaktan nefret ederler ve bu konuda asla affedici de\u011fildirler. G\xfcvenli ili\u015fkileri severler. A\u015fkta mant\u0131kla de\u011fil, duygularla hareket ederler. \u0130\xe7lerinde devaml\u0131 red edilme korkusu ile ya\u015farlar. \xc7o\u011fu kez duygular\u0131n\u0131 a\xe7\u0131klamaktan ho\u015flanmazlar. G\xfcvendikleri ki\u015filerden ald\u0131klar\u0131 destek \xe7ok \xf6nemlidir."]),t.s)
