B.Ex=A.a(s(["\u0130li\u015fkilerinde son derece k\u0131skan\xe7t\u0131r. Sevdi\u011fini kimseyle payla\u015fmak istemez. Fakat kendine kur yapacak birden fazla fl\xf6rt\xfc olabilir. Bir anda a\u015f\u0131k olur bir anda vazge\xe7ebilir. U\u011fruna \xf6zg\xfcrl\xfc\u011f\xfcn\xfc feda edebilece\u011fi \xe7ok az ki\u015fi vard\u0131r. Tutkular\u0131 derin hisleri i\xe7tendir. Ko\xe7lar sevgiye \xe7ok \xf6nem verir. \xc7ok be\u011fenilen bir ki\u015fi olsa bile, kendisine g\xfcvenmez. Hep kusurlar\u0131 oldu\u011funu d\xfc\u015f\xfcn\xfcr ve ya\u015fam\u0131 kendisine zindan eder.","Ger\xe7ek anlamda bu di\u015fi k\u0131z\u0131m\u0131za hangi erkek cesurca yakla\u015f\u0131r merek ediyoruz. Sizin i\xe7in a\u015fk ger\xe7ek bir duygudur.. \u0130nat\xe7\u0131 ve ba\u011fnaz y\xf6nleriniz bir\xe7ok erke\u011fi pes ettirecek g\xfc\xe7tedir. G\xfczel ve \xf6zel yap\u0131n\u0131z,farkl\u0131 bir karizmaya sahip havan\u0131zla her erke\u011fin ba\u015f\u0131n\u0131 d\xf6nd\xfcr\xfcrs\xfcn\xfcz.. Daha k\xfc\xe7\xfck ya\u015flarda A\u015eK sanat\u0131 \xe7\xf6zm\xfc\u015f bir hava i\xe7inde gezerken, \xe7evrenizdeki bir \xe7ok ki\u015fi sizi \xe7ok erken fark ederler.. Kom\u015fu \xe7ocuklar\u0131n\u0131n b\xfcy\xfcd\xfckleri zaman evlenmeyi hayal ettikleri bir sembol olmak bilmem ne kadar ho\u015funuza gidiyor.. Y\u0131llar sonra gen\xe7lik itiraflar\u0131nda, dudaklar\u0131n\u0131 u\xe7uklatacak hikayeler dinlerken utanma ve gururlanma duygular\u0131 i\xe7inde gel gitler ya\u015fayacaks\u0131n\u0131z ve bu b\xfcy\xfck a\u015fklar\u0131n kahraman\u0131 olmak sizi olduk\xe7a mutlu edecektir.. Cinselli\u011finizi \xe7ok \xe7abuk ke\u015ffedeceksiniz.","A\u015fkta \xf6nce mant\u0131k desen de, k\u0131sa ve ho\u015f a\u015fklara hay\u0131r demek istemezsin. Fazla duygusall\u0131k size ho\u015f gelmeyebilir. Olduk\xe7a sosyal yap\u0131nla \xe7evren daima kalabal\u0131kt\u0131r ve a\u015fks\u0131z kalman m\xfcmk\xfcn de\u011fildir. Kar\u015f\u0131ndaki ki\u015fiyi s\xfcrekli \u015fa\u015f\u0131rtt\u0131\u011f\u0131n i\xe7in, \xe7o\u011fu kez, partnerler seninle ilgili duygular\u0131nda zorlan\u0131rlar. Bir ki\u015fiye ba\u011flanmak sizin i\xe7in \xe7ok zor oldu\u011fu i\xe7in, kalpsizlikle su\xe7lanabilirsiniz. Aniden a\u015f\u0131k olur ve \xe7ok \xe7abuk b\u0131kars\u0131n. Bir ki\u015fiye ba\u011flanman\u0131z \xe7ok zordur. S\xfcrekli plan program yapars\u0131n. \xdcstelik bu planlar\u0131 yaparken, kar\u015f\u0131 tarafa asla sezdirmeyecek kadar da, ak\u0131ll\u0131s\u0131n. Seninle birlikte olacak ki\u015filerin asla seni ele\u015ftirmemeleri gerekiyor. Azarlanmaktan ve de\u011fer verilmemekten nefret edersin.. En ula\u015f\u0131lmaz ki\u015fileri bile kendine kolayca ba\u011flars\u0131n.","Sevgi dolu ve sahiplenicisin. A\u015f\u0131k oldu\u011fun zaman hi\xe7 kimseyi g\xf6z\xfcn g\xf6rmez, k\u0131r\u0131lmaktan ve g\xfccenmekten korkars\u0131n. Sevdi\u011fin ki\u015fi seninle konu\u015furken s\xf6zlerine \xe7ok dikkat etmek zorundad\u0131r. A\u015fk senin i\xe7in ya\u015fam\u0131n en \xf6nemli duygusudur.. Be\u011fendi\u011fin biri kar\u015f\u0131na \xe7\u0131kt\u0131\u011f\u0131 zaman hemen harekete ge\xe7mez, kar\u015f\u0131 taraf\u0131n seninle ilgilenmesini istersin. Uzun zaman b\u0131kmadan sevdi\u011fin ki\u015finin duygular\u0131n\u0131 a\xe7\u0131klamas\u0131n\u0131 beklersin. Platonik a\u015fklar\u0131n kahraman\u0131 olmak bilmem sana ne kazand\u0131r\u0131r. Sen uzun vadeli a\u015fklar\u0131n ki\u015fisi oldu\u011fun i\xe7in kar\u015f\u0131na \xe7\u0131kan ki\u015finin k\u0131sa fl\xf6rt duygular\u0131 seni k\u0131rar ve yaralar. Gizli g\xf6zya\u015flar\u0131n\u0131 belki onlar g\xf6rmeyecektir ama geceler boyu a\u011flad\u0131\u011f\u0131n yast\u0131klar\u0131n say\u0131s\u0131n\u0131 y\u0131llarca unutmayacaks\u0131n. An\u0131lar\u0131nda neler yoktur ki? Kurutulmu\u015f \xe7i\xe7ekler, ilk sinema biletleriniz, ilk telefon mesajlar\u0131, birlikte gitti\u011finiz yerlerin k\xfc\xe7\xfck an\u0131lar\u0131, onunla ilk bulu\u015ftu\u011funuz g\xfcn kulland\u0131\u011f\u0131n parf\xfcm daha neler neler.","\xd6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn ve ba\u015f\u0131nda g\xf6r\xfcnmeyen bir ta\xe7la dola\u015f\u0131rs\u0131n. K\u0131skan\xe7 oldu\u011fun halde, kendin k\u0131skan\xe7l\u0131\u011fa dayanamazs\u0131n\u0131z. Ya\u015fama \xe7ok ba\u011fl\u0131 oldu\u011fun i\xe7in e\u011flenceli ve ak\u0131ll\u0131 erkelerden ho\u015flan\u0131rs\u0131n. A\u015fk konusunda ayaklar\u0131n hep yerdedir. Gezmeyi ve e\u011flenmeyi seversin ama asla u\xe7ar\u0131 bir k\u0131z de\u011filsin. Aldat\u0131lma konusunda son derece duyarl\u0131s\u0131n ve affetme \xf6zelli\u011fin asla yoktur. Duygular\u0131n\u0131 iyi kontrol edersin. Sana kar\u015f\u0131 art niyetsiz sevgi g\xf6sterildi\u011fi zaman, sende ayn\u0131 \u015fekilde davran\u0131rs\u0131n. Do\u011fal bir asalete sahipsin. Affedici \xf6zelli\u011fin yo\u011fun duygular\u0131ndan dolay\u0131 k\u0131s\u0131tl\u0131d\u0131r. Ya\u015fam\u0131n do\u011fru k\u0131zlar\u0131 oldu\u011fun i\xe7in, a\u015fk hayat\u0131nda ikili davran\u0131\u015f bi\xe7imlerine kar\u015f\u0131s\u0131n ve kar\u015f\u0131ndaki ki\u015finin yalan\u0131n\u0131 \xe7abuk g\xf6r\xfcrs\xfcn. Seninle ya\u015famak zor, ayn\u0131 zamanda kolayd\u0131r.","Mant\u0131k ve duygu karma\u015fas\u0131 ya\u015fad\u0131klar\u0131 i\xe7in, s\xfcrekli d\xfczen aray\u0131\u015f\u0131 i\xe7indedirler. Ya\u015famlar\u0131nda ger\xe7ek a\u015fk\u0131n sadece mant\u0131k s\xfczgecinden ge\xe7ti\u011fine inand\u0131klar\u0131 i\xe7in, isteklerine kavu\u015fmak i\xe7in idealleri i\xe7in ya\u015farlar. \u0130stemeseler de \xf6n yarg\u0131l\u0131 olmaktan kendilerini alamazlar. Birlikte oldu\u011fu ki\u015fi s\xfcrekli m\xfckemmel g\xf6rmek istedikleri i\xe7in, partnerlerini tenkitleriyle ya\u015famlar\u0131ndan bezdirebilirler. Y\xfcksek standartlar\u0131 zamanla kendileriniz de rahats\u0131z eder. \xc7ok ge\xe7 ya\u015flarda evlenen bir \xe7ok m\xfczmin bekar Ba\u015fak bulman\u0131z m\xfcmk\xfcnd\xfcr. Kendilerini kolay teslim edemezler. Ya\u015fam\u0131 sorgulamaktan vazge\xe7medikleri m\xfcddet\xe7e duygular\u0131nda \xf6n yarg\u0131l\u0131 olmaya devam ettikleri m\xfcddet\xe7e a\u015fklar\u0131n\u0131 zor ya\u015fayacaklard\u0131r. Ya\u015fam\u0131 ve a\u015fk\u0131 sorgulamaktan vazge\xe7melisiniz. Duygular\u0131n\u0131z\u0131n sizi yan\u0131ltabilece\u011fi ku\u015fkular\u0131na art\u0131k son vermeli, \xf6n yarg\u0131l\u0131 davranman\u0131n yanl\u0131\u015flar\u0131n\u0131 g\xf6rmelisiniz. A\u015fk\u0131n k\xfc\xe7\xfck detaylar\u0131 yerine, size sunulan g\xfczelliklerini ya\u015famal\u0131s\u0131n\u0131z.","Hi\xe7 ku\u015fkusuz m\xfckemmel bir a\u015f\u0131ks\u0131n\u0131z. A\u015fk\u0131 yaratan Ven\xfcs \xf6nce sizi yaratm\u0131\u015f. Sevgi aray\u0131\u015flar\u0131n\u0131z hi\xe7 bitmedi\u011fi i\xe7in de, dengeleriniz s\xfcrekli hassast\u0131r. Bazen a\u015fks\u0131z ya\u015fama korkusu y\xfcz\xfcnden, kendinizi yanl\u0131\u015f ili\u015fkiler i\xe7inde bulabilirsiniz. Evlilik ve a\u015fk i\xe7in yarat\u0131lm\u0131\u015fs\u0131n\u0131z. A\u015fkta duygusall\u0131k ve mant\u0131\u011f\u0131 bir arada ya\u015fars\u0131n\u0131z. A\u015fk sanat\u0131n\u0131 en iyi bilen mitolojinin \xf6zel insanlar\u0131n\u0131z. Ayr\u0131l\u0131klarda \xe7abuk toparlan\u0131rs\u0131n\u0131z. \xc7\xfcnk\xfc \xe7evreniz sizi be\u011fenen bir dolu insanla \xe7evrilidir. A\u015fka a\u015f\u0131ks\u0131n\u0131z.","Bur\xe7lar ku\u015fa\u011f\u0131n\u0131n en gizemli ki\u015fisi olan Akrepler, ya\u015fam\u0131 hi\xe7te hafife almaz. \u0130\xe7lerindeki y\xfcksek duygular\u0131 onlar\u0131 ihtirasl\u0131 ve gizemli yapar. Cinsel duygular\u0131n\u0131 \xe7ok yo\u011fun ya\u015farlar.A\u015fk ya\u015fant\u0131lar\u0131 olduk\xe7a gizlidir. Kolay kap\u0131lar\u0131n\u0131 kimseye a\xe7mazlar.\u0130nsan\u0131 m\u0131knat\u0131s gibi \xe7eken bak\u0131\u015flar\u0131 vard\u0131r. Kar\u015f\u0131s\u0131ndaki ki\u015fi \xe7ok kolay etkileri alt\u0131na al\u0131rlar.Bir ili\u015fkiyi v\xfccutlar\u0131nda ve kalplerinde ayn\u0131 anda ya\u015farlar.Bildikleri tek \u015fey vard\u0131r. G\xfc\xe7l\xfc ihtiraslar\u0131 ve a\u015fka olan inan\xe7lar\u0131d\u0131r. Yasaklar\u0131 delen m\xfcthi\u015f bir sevgilidirler. Bir Akreple beraberlik \xf6nce sab\u0131rdan ge\xe7er.Birine a\u015f\u0131k olmalar\u0131 kolay olmaz..\u0130ncinmekten \xe7ok korkarlar ve kendinizi a\u015fka teslim etmek istemezler.","Olduk\xe7a macerac\u0131 bir yap\u0131ya sahip olan yay burcu a\u015fk hayat\u0131nda da bu tutkusunu s\xfcrd\xfcr\xfcr. Yay burcu a\u015fk hayat\u0131nda partneri ile s\xfcrekli gezmek ve yeni yerler ke\u015ffetmek ister. K\xfc\xe7\xfck seyahatler bile onu heyecanland\u0131rmaya yetecektir. Yay burcu a\u015fk hayat\u0131nda, uzun s\xfcreli bir ili\u015fki i\xe7inde bile olsa, heyecan pe\u015findedir.","Duygular\u0131n\u0131 ne kadar kontrol alt\u0131nda tutsan da, sevgi dolu bir yap\u0131n var. A\u015fk\u0131n zaman i\xe7inde olgunla\u015facak ve co\u015facakt\u0131r. Zor bir k\u0131zs\u0131n. Senin kalbine girmek o kadar kolay de\u011fildir. \u0130lk g\xf6r\xfc\u015fte a\u015f\u0131k olanlardan de\u011filsin. \xdcstelik \xe7ok zor be\u011fenirsin. Kriterlerin \xe7ok y\xfcksektir. Ya\u015fama \xe7ok farkl\u0131 bakars\u0131n. \xc7ocuksu erkeklere tahamm\xfcl\xfcn yoktur. Seni kazanacak ki\u015finin \xf6ncelikle olgun olmas\u0131 gerekiyor. \u0130steklerini her ne kadar dile getirmek istemesen de, hep \xfcst d\xfczeyde bir a\u015fk\u0131n hayalini kurars\u0131n. O\u011flaklar\u0131n genelde a\u015fklar\u0131n ya\u015f fark\u0131 fazlad\u0131r. Kar\u015f\u0131s\u0131ndaki ki\u015filerin tarz\u0131na hayran olduklar\u0131 i\xe7in, a\u015fk\u0131 da sayg\u0131 \xe7er\xe7evesi i\xe7inde ya\u015famak isterler.","Bir a\u015fka ba\u015flamak istedi\u011finde; duygular\u0131n\u0131 saklar ve elde edilmesi zor bir ki\u015fiyi oynars\u0131n. Kar\u015f\u0131ndaki ki\u015fiyi zorlamaktan ho\u015flan\u0131rs\u0131n. Gereksiz samimiyetten ho\u015flanmazs\u0131n. Kar\u015f\u0131ndaki ki\u015finin d\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfc \xf6nemli de\u011fildir. A\u015fkta ileti\u015fi korkusu ya\u015fad\u0131\u011f\u0131n i\xe7in, a\u015fka kolay teslim olmazs\u0131n. Bazen korkakl\u0131kla su\xe7lanabilirsin. \u0130leti\u015fim korkusu y\xfcz\xfcnden kendini s\xfcrekli geriye \xe7ekersin. Ya\u015fam\u0131n\u0131 biriyle payla\u015fma acelen yoktur. \xd6zg\xfcrl\xfck ve anlay\u0131\u015f senin i\xe7in her \u015feyden \xf6nemlidir. Kar\u015f\u0131ndaki ki\u015finin zeki olmas\u0131 ve onunla fikir jimnasti\u011fi yapmas\u0131 gerekir. Ciddi bir \u015fekilde manyetik bir g\xfcce sahipsin. Kalabal\u0131k ortamlarda bile fark edilirsin. Kendine has garip bir ihtiras\u0131n vard\u0131r. \u0130li\u015fkin fazla ciddile\u015fti\u011fi zaman, hemen kendini geriye \xe7ekersin. Fazla samimiyet seni korkutur. Do\u011fru zaman ve do\u011fru partneri bulmak senin i\xe7in \xe7ok \xf6nemlidir. \u0130\u015fte o zaman, kalbinin t\xfcm kap\u0131lar\u0131n\u0131 a\xe7ars\u0131n. Bunun \xe7ok kolay olmayaca\u011f\u0131n\u0131 bildi\u011fin i\xe7in \xe7o\u011fu zaman gizli pi\u015fmanl\u0131klar\u0131n vard\u0131r.","G\xfczel ve her iki cins de bak\u0131ml\u0131 oldu\u011funuz i\xe7in, \xe7evrenizde sizi be\u011fenen binlerce ki\u015fi vard\u0131r. Genelde narin bir yap\u0131n oldu\u011fu i\xe7in \xe7ok \xe7abuk incinirsin. Y\xfcz ifaden durgun ve sakin oldu\u011fu i\xe7in, kar\u015f\u0131ndaki ki\u015fiye huzur verirsin. Fakat garip bir y\xf6n\xfcn vard\u0131r, \xe7ok mutlu g\xf6r\xfcnd\xfc\u011f\xfcn anlarda bile an\u0131nda \xfcz\xfclebilirsin. Seni d\u0131\u015f d\xfcnyan\u0131n sorunlar\u0131ndan koruyacak ger\xe7ek bir a\u015fka ihtiya\xe7 duyars\u0131n. Duygular\u0131n\u0131 payla\u015facak birilerinin olmas\u0131 \xe7ok \xf6nemlidir. Hep imkans\u0131z a\u015fklar\u0131 kendine \xe7ekersin. \u0130\xe7inde saklad\u0131\u011f\u0131n \xf6zel duygular\u0131n\u0131 hi\xe7 kimseyle payla\u015fmak istemedi\u011fin i\xe7in, y\u0131llar sonra anlatt\u0131\u011f\u0131n platonik a\u015fk hikayelerini, \u015fa\u015fk\u0131nl\u0131k i\xe7inde dinleyenler, b\xf6yle duygular\u0131n ya\u015fanm\u0131\u015f olaca\u011f\u0131na inanamazlar. Her t\xfcrl\xfc ac\u0131y\u0131 g\xfcler y\xfczle kar\u015f\u0131layan sana nas\u0131l bir takdir kazand\u0131racak? Kendine sorman gereken \xe7ok soru var."]),t.s)
B.Ey=A.a(s(["Bu ki\u015filer olduk\xe7a \xe7ekici ve etkileyicidirler. Otoriterdirler. \u0130stekleri ger\xe7ekle\u015ftirme konusunda engel tan\u0131mazlar. Ayn\u0131 zamanda c\xfcretkard\u0131rlar. Kar\u015f\u0131 taraf\u0131 avlamas\u0131 gereken bir av olarak g\xf6r\xfcrler. Bir Ko\xe7\u2019la ili\u015fki ya\u015famak o kadar kolay de\u011fildir. E\u011fer uzun s\xfcreli bir beraberlik planl\u0131yorsan\u0131z, her an her \u015feye haz\u0131r olmal\u0131s\u0131n\u0131z. Heyecanl\u0131 ve meydan okuyan bir ki\u015filikleri vard\u0131r.Ya\u015famlar\u0131nda ikinci olmaktan nefret ettikleri i\xe7in de, beraberliklerine kendi damgalar\u0131n\u0131 vuran Ko\xe7\u2019lar\u0131n yan\u0131nda olmak bile ba\u015fl\u0131 ba\u015f\u0131na bir olayd\u0131r. Birlikte olduklar\u0131 ki\u015fiyi nefessiz b\u0131rakacak kadar hareketlidirler. Disipline gelemeyen ara\u015ft\u0131rmac\u0131 ruhlar\u0131n\u0131n derinliklerinde, onlara e\u015flik edecek bir sevgiliye gereksinim duyarlar ve ya\u015famlar\u0131nda duygular\u0131yla yar\u0131\u015f\u0131rlar. Ba\u011f\u0131ms\u0131z ki\u015filiklerinin s\xfcrekli sevgi ile beslenmeye ihtiya\xe7lar\u0131 vard\u0131r. A\u015fkta zafere ula\u015fmak isterler. Daha gen\xe7 ya\u015flarda kafas\u0131ndaki ki\u015finin tipi ve ki\u015fili\u011fini \u015fekillendirmi\u015ftir. K\u0131skan\xe7l\u0131k, onun duygular\u0131n\u0131 besleyece\u011fi i\xe7in, bu \xf6zelliklerinden s\u0131yr\u0131lmalar\u0131n\u0131 beklememelisiniz. Gururludur ve k\u0131r\u0131ld\u0131\u011f\u0131 zaman kolay affetmez. S\xfcrekli \xf6vg\xfcye ve takdir edilmeye ihtiya\xe7 duyarlar.","Ciddi ve sakin yap\u0131lar\u0131 ile, iyi bir aile reisi olmaya adayd\u0131rlar. Son derece sab\u0131rl\u0131, pratik ve \xe7\xf6z\xfcmleyicidirler. Do\u011fu\u015ftan baba \xf6zelliklerine sahip olduklar\u0131 i\xe7in muhakkak baba olmalar\u0131 gerekmez. \xc7evresindeki her \xe7ocu\u011fa ger\xe7ek bir \u015fevkat g\xf6sterir. Y\xfcksek standartta ya\u015fad\u0131klar\u0131 i\xe7in, konforlu bir hayata hi\xe7bir zaman \u201chay\u0131r\u201d demezler. En b\xfcy\xfck ama\xe7lar\u0131; sevdikleri ile birlikte, duygu dolu anlar ya\u015famalar\u0131d\u0131r. K\xf6klerine \xe7ok ba\u011fl\u0131 olan bu ki\u015filer, \xf6m\xfcr boyu ya\u015fl\u0131 akrabalar\u0131n\u0131n her t\xfcrl\xfc sorunlar\u0131na ko\u015farlar. Ya\u015fam\u0131n temel ta\u015flar\u0131 olduklar\u0131 i\xe7in de ne zaman ba\u015f\u0131 s\u0131k\u0131\u015fan bir dostu varsa o her zaman ordad\u0131r. Onlara \xf6zel g\xfcnlerinde, \xe7ok sevdikleri bir kitap, deri bir c\xfczdan, elektronik oyunlar, onlar\u0131 rahat ettirecek aksesuar niteli\u011finde e\u015fyalar, \xf6rne\u011fin; bir ku\u015f t\xfcy\xfc yast\u0131k alabilirsiniz.","Hareketli ve de\u011fi\u015fken yap\u0131lar\u0131yla dikkat \xe7ekmemeleri m\xfcmk\xfcn de\u011fildir.Sonsuz bir \xf6\u011frenme iste\u011fi i\xe7inde olduklar\u0131 i\xe7in \xe7evrelerine asla kay\u0131ts\u0131z kalmalar\u0131 m\xfcmk\xfcn de\u011fildir. Etraf\u0131n\u0131zda her an e\u011flenceli bir \u0130kizler g\xf6rmeniz m\xfcmk\xfcnd\xfcr. A\u015fk ya\u015fant\u0131lar\u0131 daima bir soru i\u015fareti olup, kendisi dahil hi\xe7 kimse onun ne yapt\u0131\u011f\u0131 konusunda belli bir fikri yoktur. Ya\u015fam boyunca \xe7evresini sorgulamaktan vazge\xe7meyen bu ilgin\xe7 ki\u015filerin pe\u015fine tak\u0131ld\u0131\u011f\u0131n\u0131z zaman asla s\u0131k\u0131lmaz hatta fazlas\u0131yla e\u011flenebilirsiniz. Bir \u0130kizler babas\u0131 d\xfcnyan\u0131n en tatl\u0131 ki\u015fisidir. \xc7ocuklar\u0131 i\xe7in inan\u0131lmaz zevkli bir oyun arkada\u015f\u0131d\u0131r. \xc7ocuklar\u0131 b\xfcy\xfcd\xfckleri zaman bile onlara arkada\u015f muamelesi yaparlar. S\xfcrekli babalar\u0131 ile beraber olmak isteyen \xe7ocuklar\u0131 , onu her zaman yanlar\u0131nda bulamayabilirler, \xc7\xfcnk\xfc s\xfcrekli seyahat etmekten ho\u015flan\u0131rlar. . Bug\xfcn ona en \xe7\u0131lg\u0131n hediyeleri alabilirsiniz. Orijinal spor ayakkab\u0131lar, kaliteli bir g\xfcne\u015f g\xf6zl\xfc\u011f\xfc, renkli ti\u015f\xf6rtler, bluejeanler ve bir seyahat \xe7antas\u0131na hay\u0131r demez.","Sakin ve dengeli yap\u0131lar\u0131 onlar\u0131 bulunduklar\u0131 ortam\u0131n en sevilen ki\u015fisi haline getirir. Duygular\u0131n\u0131 \xe7ok derin ya\u015fad\u0131klar\u0131 i\xe7in, gizemli bir tablo i\xe7inde ya\u015farlar. Sevilen ve aran\u0131lan insanlard\u0131r. Bulunduklar\u0131 ortam\u0131n \u015fartlar\u0131na \xe7ok \xe7abuk uyum sa\u011flad\u0131klar\u0131 i\xe7in, asla \u015fikayet etmezler ve edenlerden de ho\u015flanmazlar.Aile kavram\u0131 \xe7ok fazlad\u0131r. \u0130yi bir baba ve iyi bir e\u015ftir. \xc7ocuklar\u0131na d\xfc\u015fk\xfcn olduklar\u0131 i\xe7in, koruma i\xe7g\xfcd\xfcleri her zaman ataktad\u0131r. Al\u0131ngan olduklar\u0131 i\xe7in de k\u0131r\u0131ld\u0131klar\u0131 zaman kap\u0131lar\u0131n\u0131 \xe7ok \xe7abuk \xe7evrelerine kapat\u0131rlar. \xc7eversine hep yaral\u0131 olmak istedikleri i\xe7in de \xe7o\u011fu kez yanl\u0131\u015f bir \u015fekilde kullan\u0131l\u0131rlar.","S\u0131cak romantik, ate\u015fli a\u015f\u0131klard\u0131r. Birlikte oldu\u011fu insan\u0131 ayaklar\u0131n\u0131 yerden keser. \u0130yi bir konu\u015fmac\u0131 oldu\u011fu i\xe7inde, g\xfczel a\u015fk s\xf6zleri s\xf6ylemekte \xfcstlerine yoktur.Bulunduklar\u0131 her ortamda sevgi krall\u0131klar\u0131n\u0131 ilan etmeye haz\u0131rd\u0131rlar.Kar\u015f\u0131 cins \xe7ekici ve toplum i\xe7inde kendilerini belli eden ki\u015filerdir.Cinsel a\xe7\u0131dan yo\u011fun ya\u015fad\u0131klar\u0131 duygular\u0131n\u0131 zor idare ederler.Aslan burcu ki\u015fisi partnerinden s\xfcrekli olumlu s\xf6zler duymaktan ho\u015fland\u0131klar\u0131 i\xe7in, en k\xfc\xe7\xfck bir ilgisizlik kar\u015f\u0131s\u0131nda t\xfcm dengelerini yitirirler. Ya\u015fam\u0131n karizmatik oyuncular\u0131d\u0131r. Sizi seven bir aslan erke\u011finden kurtulman\u0131z o kadar kolay olmayacakt\u0131r. O sizi se\xe7mi\u015f ise ona direnmeniz faydas\u0131zd\u0131r. Farkl\u0131 a\u015fklar\u0131n kahraman\u0131 olmaya e\u011filimlidirler. G\xfc\xe7l\xfc yap\u0131lar\u0131n\u0131 \xe7ocuklar\u0131nada yans\u0131tarak, onlar\u0131n m\xfckemmel olmas\u0131na \xe7al\u0131\u015f\u0131rlar. Aslan babas\u0131 iyi bir baba olman\u0131n t\xfcm \xf6zelliklerini ta\u015f\u0131r.","Ya\u015fama sade bakan do\u011fal ve samimi ki\u015filerdir. Onlarla ya\u015famak kolay de\u011fildir. \xc7\xfcnk\xfc disiplin duygusu i\xe7inde ya\u015fad\u0131klar\u0131 i\xe7in, birlikte olduklar\u0131 ki\u015filerin de ya\u015fam d\xfczenlerine kar\u0131\u015f\u0131rlar. Titiz ve sorgulay\u0131c\u0131d\u0131rlar. Ama\xe7s\u0131z ve beklentisiz ki\u015filer i\xe7in, zaman harcamaktan ho\u015flanmazlar. \u0130yi, bir aile reisi olduklar\u0131 s\xf6ylense de, bunu geciktirmek i\xe7in her t\xfcrl\xfc yolu denerler ve m\xfczmin bir bekar olmaktan kurtulamazlar. A\u015fk ili\u015fkileri zordur..S\xfcrekli denetleme duygular\u0131 y\xfcz\xfcnden partnerleriyle aralar\u0131nda s\xfcrekli sorun \xe7\u0131kar. Baba olduklar\u0131 zaman da bu duyguyu ge\xe7 tatman\u0131n keyifsizli\u011fini duyarlar. Onlar\u0131 en iyi ko\u015fullarda yeti\u015ftirmek i\xe7in ellerinden gelen her \u015feyi yaparlar . \xc7ocuklar\u0131 onlar\u0131n d\xfczenlerinden s\u0131k\u0131lsa bile en k\xfc\xe7\xfck sorunlar\u0131nda yanlar\u0131nda, babalar\u0131n\u0131 g\xf6rmekten keyif al\u0131rlar. Temkinlidirler ve hata yapmaktan \xe7ekinirler. M\xfckemmel olmak i\xe7in her t\xfcrl\xfc olanaklar\u0131 sonuna kadar savunur ve kullan\u0131rlar. Yapmak istedikleri ile hayalleri aras\u0131nda u\xe7urum yoktur. D\xfcnyay\u0131 kendi ki\u015fisel \xe7er\xe7evesinden g\xf6rmeye al\u0131\u015fk\u0131nd\u0131rlar. Duygusal istekleri ve arzular\u0131 \xf6n plandad\u0131r..Sabit d\xfc\u015f\xfcnme konusunda \u0131srarc\u0131 ve \xf6d\xfcn vermedikleri i\xe7in kendini zorlayacak konular ortaya \xe7\u0131kacakt\u0131r.","Bu adamdan pek \xe7ok \xf6\u011f\xfct alacaks\u0131n\u0131z. Sorunlar\u0131n\u0131z\u0131 b\xfcy\xfck bir zevkle dinleyecek ve ve size yard\u0131mc\u0131 olmak i\xe7in t\xfcm olanaklar\u0131n\u0131 kullanacakt\u0131r. Sizi o e\u015fsiz mant\u0131k g\xfcc\xfcn\xfcn etkisi alt\u0131na alacakt\u0131r. .\u0130kna kabiliyeti \xe7ok y\xfcksektir. Onunla birlikteyken, eski hayal k\u0131r\u0131kl\u0131klar\u0131n\u0131z\u0131 unutacaks\u0131n\u0131z. Size g\xfcl\xfcmsedi\u011fi anda, t\xfcm d\xfcnyan\u0131n ayaklar\u0131n\u0131z\u0131n alt\u0131nda oldu\u011funu hissedecek ve, sanki i\xe7inizden bir \u015feyler kopacak ve onun m\u0131knat\u0131s ki\u015fili\u011fi alt\u0131nda kendinizi \xe7ok farkl\u0131 d\xfcnyalar i\xe7inde bulacaks\u0131n\u0131z.Fakat Ven\xfcs\u2019\xfcn etkisinde olan bu erkekle, a\u015fk\u0131n\u0131z\u0131n sonsuza kadar s\xfcrece\u011fine inanacak kadar saf olmay\u0131n. O, sizi \xfczmeden ve k\u0131rmadan ka\xe7maya \xe7al\u0131\u015fabilir. \xc7\xfcnk\xfc, ili\u015fki kan kaybetmeden uzakla\u015fmak ve a\u015fk\u0131n\u0131 hep en g\xfczel an\u0131lar\u0131yla hat\u0131rlamak isterler. Bir terazi erke\u011fi y\xfcz ya\u015f\u0131na gelse bile,kar\u015f\u0131 cinse ilgisini kaybetmeyece\u011fi i\xe7in, \xe7evresi daima kalabal\u0131k ve kad\u0131nlarla \xe7evrili olacakt\u0131r. Zodyak\u0131n a\u015fk yapma sanat\u0131n\u0131 \xe7ok iyi bilen bu erke\u011fin kar\u015f\u0131nda hi\xe7bir kad\u0131n ilgisiz kalamayaca\u011f\u0131 muhakkak. Fakat i\u015fin ilgin\xe7 y\xf6n\xfc, ayr\u0131ld\u0131\u011f\u0131 sevgilileri ile dost ve arkada\u015f kalabilen, ender ki\u015filerdir. O, daima size sayg\u0131l\u0131 davranacak ve hi\xe7bir i\u015finize burnunu sokmayacakt\u0131r. Sizin t\xfcm s\u0131rlar\u0131n\u0131z\u0131 \xf6\u011frenmek gibi bir merak\u0131 yoktur. E\u011fer siz, b\xf6yle bir \u015feye yeltenirseniz, olduk\xe7a \u015fa\u015f\u0131racak ve g\xfcvenilmedi\u011fi duygusuna kap\u0131larak, size k\u0131r\u0131lacakt\u0131r. Terazi erke\u011fi, ayn\u0131 zamanda ya\u015fam\u0131n iyi bir yarg\u0131c\u0131d\u0131r. Onun inan\xe7lar\u0131na sayg\u0131 g\xf6stermek zorundas\u0131n\u0131z. \xc7\xfcnk\xfc, onlar i\xe7in yalan son derece i\u011fren\xe7 ve berbat bir olayd\u0131r. B\xf6yle bir duygu insan bedenini ve ruhunu kirleten bir \u015feydir. Anala\u015f\u0131lmad\u0131\u011f\u0131 zaman, ruhunun derinliklerinde gizli bir ac\u0131 ya\u015far. \u0130ncindi\u011fi zaman, nazik\xe7e sizden uzakla\u015f\u0131r.\u0130\u015fte t\xfcm bu \xf6zellikleri Terazi erke\u011fini farkl\u0131 k\u0131lar. Terazi erke\u011finin sosyal \xe7evresinde bol bol zeki ve ak\u0131ll\u0131 insanla olacakt\u0131r. Para konusunda eli s\u0131k\u0131 biri de\u011fildir. Dostlar\u0131n\u0131 en iyi \u015fekilde a\u011f\u0131rlamas\u0131n\u0131 bilir. Sanat ve entellekt\xfcellik ta\u015f\u0131yan konular ilgisini \xe7eker. Kalabal\u0131k ve kapal\u0131 yerlerden s\u0131k\u0131l\u0131r. Nezih ve kaliteli ortamlar\u0131 tercih ederler. Ruhsal dengelerini korumak i\xe7in ger\xe7ekten her \u015feyin uyum i\xe7inde olmas\u0131n\u0131 isterler. E\u011fer bir Terazi erke\u011fine a\u015f\u0131k olursan\u0131z, hemen vakit kaybetmeden gidin ve teklifinizi ona yap\u0131n. Sizi ger\xe7ekten be\u011fenmi\u015fse belki biraz naz yapacakt\u0131r. Fakat onu duygu karars\u0131zl\u0131klar\u0131ndan kurtarm\u0131\u015f olursunuz.. Sizi ger\xe7ekten be\u011feniyorsa, oda bu teklifiniz kar\u015f\u0131s\u0131nda rahatlayacakt\u0131r. \xc7\xfcnk\xfc bu zarif adam, a\u015fk konusunda ilk ad\u0131m\u0131 atacak kadar cesur de\u011fildir.","Derin bir duygu insan\u0131d\u0131rlar. Olaylara g\xfc\xe7l\xfc bir mant\u0131kla yakla\u015ft\u0131klar\u0131 i\xe7in, onlara her konuda g\xfcvenilir. Haf\u0131zalar\u0131 \xe7ok kuvvetlidir. Bir konuyu bir kez s\xf6ylemek yeterlidir. Hat\u0131rlat\u0131lmaktan nefret ederler. Asla y\xfczeysel bir ki\u015fi olamazlar. \xc7ocuklar\u0131 ile ileti\u015fim kurma konusunda, ketumdur. Onlardan g\xfc\xe7l\xfc bir ki\u015filik, ya\u015fama kar\u015f\u0131 dayan\u0131kl\u0131 olmalar\u0131n\u0131 bekler. Bir av t\xfcfe\u011fi, deri bir evrak \xe7antas\u0131, sert bir tra\u015f losyonu, g\xfczel bir ajanda. Deriden yap\u0131lm\u0131\u015f her t\xfcrl\xfc e\u015fyay\u0131 sever.","Yay burcu erke\u011fi entelekt\xfcel bir ki\u015fili\u011fe sahiptir. Kibar, son derece bilgili ve beyefendi bir erkektir. Hayat\u0131n\u0131n her alan\u0131nda bu \u015fekilde ya\u015famak ister. Asl\u0131nda bu durumun onlar i\xe7in \xe7ok \xf6nemlidir. Renkli, sevecen ve \u0131l\u0131ml\u0131d\u0131rlar. Cana yak\u0131n davran\u0131\u015flar\u0131 ile insanlar taraf\u0131ndan sevilen bir erkektir.","Ketum ve ciddi tav\u0131rlar\u0131 ile tan\u0131nan bir O\u011flak erke\u011finin yumu\u015fac\u0131k bir kalbi vard\u0131r.D\u0131\u015fardan g\xf6r\xfclen g\xf6r\xfcnt\xfcs\xfcn\xfcn alt\u0131nda \xe7ekingen ve duygusal bir ki\u015filik yatar. Akl\u0131 ba\u015f\u0131nda ve g\xfcvenilirdir.\xc7evresinde olup bitenleri, mant\u0131k \xe7er\xe7evesinde g\xf6zlemler. Sert bir mant\u0131kla yakla\u015f\u0131r ve sonu\xe7 her zaman do\u011frudur.Sakin ve sade ki\u015filerdir. Olaylar\u0131 abartmad\u0131klar\u0131 i\xe7in de baz\u0131 ki\u015filere renkli gelmeyebilirler. Aile kavramlar\u0131 \xe7ok \xf6nemlidir ve klasik bir anlay\u0131\u015flar\u0131 vard\u0131r Se\xe7tikleri e\u015f toplumsal ve geleneksel kurallara uygundur.\u0130yi bir babad\u0131rlar. Fakat so\u011fuk bir yakla\u015f\u0131m tarzlar\u0131 oldu\u011fu i\xe7in, daima \xe7ocuklar\u0131 ile aralar\u0131nda belli bir mesafe vard\u0131r. Onlar\u0131 ya\u015fama erken \xf6\u011fretmek i\xe7in \xe7abalarlar. . A\u015f\u0131r\u0131 bir \u015fekilde ku\u015fkuculard\u0131r, kolay inanmazlar ama inand\u0131klar\u0131 bir konuyu da sonuna kadar inatla savunurlar. \xc7al\u0131\u015fmalar\u0131nda sab\u0131r ve \xf6zenle \xe7al\u0131\u015f\u0131rlarken, g\xf6steri\u015ften uzak bir \u015fekilde i\u015flerini yaparlar","Zeki ve ak\u0131ll\u0131 ki\u015filerdir. Ya\u015fam\u0131 asla \u015fakaya almazlar. Olaylar\u0131 ak\u0131ll\u0131ca de\u011ferlendirdikleri i\xe7in anla\u015f\u0131lmas\u0131 zor ki\u015filerdir. Ne yapacaklar\u0131 ve nerede olacaklar\u0131n\u0131 kestirmeleri \xe7ok zordur. Hi\xe7 kimsenin d\xfc\u015f\xfcnmedi\u011fi olaylar\u0131 ya\u015fad\u0131klar\u0131 i\xe7in de, \xe7evreleriyle aralar\u0131nda g\xf6r\xfcnmez bir perde olu\u015ftururlar. Ya\u015fama pratik bakarlar. Bulunduklar\u0131 ortam\u0131n \xe7ok ilerisinde d\xfc\u015f\xfcn\xfcrler. \xc7evrelerinde be\u011fenilen ve sayg\u0131 duyulan ki\u015filerdir. Olaylar\u0131 gerekti\u011finden daha hafife al\u0131p, panik olmad\u0131klar\u0131 i\xe7in, politik yakla\u015f\u0131mlar geli\u015ftirerek, kestirmeden sonuca ula\u015f\u0131rlar. \u0130\u015fler iyi giderken, her \u015fey kontrolleri alt\u0131ndad\u0131r. Hayatlar\u0131nda \xe7eli\u015fkiye neden olan insanlar\u0131 g\xf6rmezlikten gelirler. Cesaret ve rahatl\u0131klar\u0131, bazen \xe7izmeyi a\u015fan sorunlara neden olur. Oyuncu yetenekleri \xe7ok geli\u015fmi\u015f oldu\u011fu i\xe7in, bazen toplum kar\u015f\u0131s\u0131nda da rol yapabilirler. \xd6\u011frenme kabiliyetleri \xe7ok y\xfcksektir.. M\xfckemmeliyet\xe7i yap\u0131lar\u0131ndan dolay\u0131, sert bir g\xf6r\xfcn\xfcm sergileseler de, zevkine ve konforuna d\xfc\u015fk\xfcnd\xfcrler Temkinli, sa\u011flamc\u0131 hatta ku\u015fkucu yap\u0131lar\u0131 onlar\u0131n ba\u015far\u0131ya gitmesindeki en b\xfcy\xfck etkendir.. Ayr\u0131nt\u0131lara \xe7ok \xf6nem verirler fakat, ya\u015fad\u0131\u011f\u0131 duygusal k\u0131r\u0131kl\u0131klar\u0131 belli etmezler. \xc7ocuklarla aras\u0131 daima iyidir ve onlara anlatacak \xe7ok \u015feyleri vard\u0131r. Elektroni\u011fe olan merak\u0131 y\xfcz\xfcnden \xe7evresini oyalayacak elinde doneleri \xe7ok fazlad\u0131r. Bazen garip bir yaln\u0131zl\u0131k duygusuna kap\u0131ld\u0131klar\u0131 i\xe7in , onu ho\u015f g\xf6rmek gerekir. Bu duygu ge\xe7ti\u011fi zaman, tekrar size d\xf6necektir. \u0130yi bir baba olmas\u0131na ra\u011fmen \xe7ocuklar\u0131n\u0131n ayaklar\u0131n\u0131 sa\u011flam basmas\u0131 i\xe7in, \xe7o\u011fu kez onlar\u0131 tek ba\u015flar\u0131na karar vermelerini ister.","O, yaln\u0131z bir adamd\u0131r.. Ne zaman, ne yapaca\u011f\u0131 hi\xe7 belli olmaz. Onu tan\u0131makla \u015fansl\u0131 m\u0131s\u0131n\u0131z, hi\xe7 bilinmez. Size elini uzat\u0131r ve kendi denizinde birlikte y\xfczmenizi teklif eder. Oysa, her \u015fey size yapanc\u0131d\u0131r. \u015ea\u015fk\u0131nl\u0131kla ona e\u015flik etmeye \xe7al\u0131\u015f\u0131rs\u0131n\u0131z. Sizin s\u0131n\u0131rlar\u0131n\u0131z\u0131 bilmez. Hep kendi sular\u0131nda y\xfczer. Y\xfczmeyi onun kadar bilmiyorsan\u0131z, al\u0131r ba\u015f\u0131n\u0131 \xe7eker gider. Ona belki de asla bir daha kar\u015f\u0131la\u015fma \u015fans\u0131n\u0131z olamayacak ve ak\u0131l\u0131n\u0131zda daima g\xf6zya\u015flar\u0131n\u0131 silen bir Bal\u0131k hat\u0131rlayacaks\u0131n\u0131z. Bir g\xfcn bitti\u011fine sizde inanmayacaks\u0131n\u0131z. Belki de y\u0131llar sonra, yan\u0131n\u0131zda size e\u015flik edecek bir Bal\u0131k erke\u011fi olacakt\u0131r. Hangisinin olaca\u011f\u0131n siz karar vereceksiniz. Kendi de\u011fer yarg\u0131lar\u0131na g\xf6re ya\u015famaktan yanad\u0131r. \xc7evreye farkl\u0131 gelen yap\u0131s\u0131yla hep bir giz olarak an\u0131lacakt\u0131r. Kendisini g\xfcven i\xe7inde hissetmesi i\xe7in, s\xfcrekli korunmaya ihtiyac\u0131 vard\u0131r. Bu \u015fartlar\u0131 ona sa\u011flarsan\u0131z, \xf6m\xfcr boyu size yaslanacak ve mutlu olacakt\u0131r. Kendisinden uzakla\u015ft\u0131\u011f\u0131n\u0131z\u0131 fark ederse, sessizce ba\u015fka g\xfcvenler arayacakt\u0131r."]),t.s)
B.EF=A.a(s(["Onunla tan\u0131\u015ft\u0131\u011f\u0131n\u0131z anda farkl\u0131l\u0131\u011f\u0131n\u0131 hissedersiniz. Ya \xe7ok sever veya hi\xe7 sevmezsiniz. Asla ortas\u0131 yoktur. Engeller ve bask\u0131lar onu korkutmaz ve hep kendilerini ba\u015far\u0131ya odaklam\u0131\u015flard\u0131r. Belli hedefleri vard\u0131r. Sa\u011fa sola \xe7arparak ama\xe7lar\u0131na ula\u015f\u0131rlar. D\xfc\u015fe kalka ya\u015famaktan yorulmayan g\xfc\xe7l\xfc bir Mars enerjisine sahiptirler. Hatta, stresli i\u015fleri adeta kendileri davet eder. Onlarla bir i\u015f yerini payla\u015fmak kolay de\u011fildir. Kolay emekli olmak istemezler. Do\u011fal giri\u015fim yetene\u011fi ve liderlik \xf6zellikleri ile y\xf6neticilik basamaklar\u0131n\u0131 kolayca \xe7\u0131kar.","Onun a\u015f\u0131r\u0131 disipline \xf6nem vermesi her \u015feyi kendi sistemleri i\xe7inde \xe7\xf6zmeye \xe7al\u0131\u015fmas\u0131 bir \xe7ok ki\u015fiye ters gelebilir. \xd6zellikle; pratik \xe7al\u0131\u015fmay\u0131 ye\u011fleyen ki\u015filerle anlamas\u0131 m\xfcmk\xfcn de\u011fildir. Sa\u011flama yapmadan hi\xe7bir \u015feyden emin olamad\u0131\u011f\u0131 i\xe7in, acele i\u015fleri sevenler i\xe7in zor bir insand\u0131r. Yanl\u0131\u015f bir yolda iken, bilgi\xe7 bir tav\u0131rla onun hatas\u0131n\u0131 bildirdi\u011finizde \xe7ok sert bir tepki alabilirsiniz. Bo\u011fa\u2019lar kendi hedeflerine ula\u015fmak i\xe7in \xf6ylesine \xe7ok \xe7al\u0131\u015f\u0131rlar ki, yan\u0131nda \xe7al\u0131\u015fanlar ki\u015fisel hedeflerini kontrol alt\u0131nda tutmak zorundad\u0131rlar.","Herkese dost\xe7a davran\u0131r, \u015fakac\u0131 ve rahatt\u0131r. Birlikte \xe7al\u0131\u015ft\u0131klar\u0131 ki\u015filere b\xfcy\xfck bir ilgi g\xf6sterir. S\xfcrekli hareket halinde olmas\u0131 nedeniyle arkada\u015flar\u0131n\u0131n kafas\u0131n\u0131 kar\u0131\u015ft\u0131r\u0131r. \u0130kizlerin h\u0131zl\u0131 \xe7al\u0131\u015fan aktif bir zekas\u0131 oldu\u011fu i\xe7in, \xe7evresindeki ki\u015filerin a\u011f\u0131r \xe7al\u0131\u015fma temposunu bir t\xfcrl\xfc anlayamaz. \u0130steksiz ve keyifsiz oldu\u011fu g\xfcnlerde, \xf6zel telefonlar\u0131na bile cevap vermez. Kendisini arayan ki\u015finin \xfcnvan\u0131 ve pozisyonu onu etkilemez. Ba\u015fkalar\u0131n\u0131n \xf6nerilerine kulak vermeyen \u0130kizlerle i\u015f yerinde birlikte olmak, sinirlendirici oldu\u011fu kadar zevklidir de.","\xd6n sezileri g\xfc\xe7l\xfcd\xfcr. G\xfcvendi\u011fi ve sayg\u0131 duydu\u011fu ki\u015filere kar\u015f\u0131 c\xf6mert ve payla\u015f\u0131mc\u0131d\u0131r. Bulundu\u011fu i\u015f yeri \xe7evresine g\xfcvenme konusunda zamana ihtiyac\u0131 vard\u0131r. \xc7evresindeki ki\u015filerle ilgili t\xfcm detaylar\u0131 bilmek ister. \xd6zellikle; onlar\u0131n aile yap\u0131s\u0131 ve ya\u015fad\u0131klar\u0131 \u015fartlar\u0131 s\u0131k\u0131 bir \u015fekilde de\u011ferlendirir. Yeni \u015fartlara kolay uyum sa\u011flayamayacakt\u0131r. Kendisine ait olan her \u015feye sahip \xe7\u0131kmas\u0131 nedeniyle, i\u015f yerinde herkesin dostu ve arkada\u015f\u0131 olur. Bazen, bu \xf6zelli\u011fi sorun olabilir ve sevdikleri herkesi savunmaya kalkarlar ve tart\u0131\u015fmalara neden olurlar. Kendi sevgi \xe7emberine ald\u0131klar\u0131 ki\u015filere, kimsenin m\xfcdahale etmesini istemezler.","M\xfckemmel bir \u015firket ba\u015fkan\u0131d\u0131r. Ba\u015fkalar\u0131n\u0131n farkl\u0131 yeteneklerini \xe7ok iyi anlar ve de\u011ferlendirir. Her konuda a\xe7\u0131k ve net bir stile sahiptirler. Onaylad\u0131\u011f\u0131 konuyu hareketleri ile belli eder. Ba\u015flad\u0131\u011f\u0131 bir i\u015f konusunda son derece sebatkard\u0131r. Hi\xe7 ara vermeden uzun s\xfcre \xe7al\u0131\u015fabilir hatta g\xfcnlerce \xe7evresindeki her \u015feyi unutur. Konu bitti\u011fi zaman da hi\xe7 kimse onu yerinden k\u0131m\u0131ldatamaz. Onu ilgilendiren her \u015fey g\xf6rkemli ve g\xf6steri\u015fli olmal\u0131d\u0131r. Birlikte \xe7al\u0131\u015ft\u0131\u011f\u0131 ki\u015filer; dar kafal\u0131 ve k\xf6t\xfc bir organizat\xf6rse, bulundu\u011fu yeri terk edebilir. Gen\xe7lerle \xe7al\u0131\u015fmaktan daha b\xfcy\xfck zevk al\u0131rlar.","Onun m\xfckemmel olma tutkusu y\xfcz\xfcnden, k\xf6t\xfc bir \xe7al\u0131\u015fma arkada\u015f\u0131 olabilir. Dikkat ve metot ki\u015fisidir.Yan\u0131nda \xe7al\u0131\u015fanlardan s\xfcrekli ayr\u0131nt\u0131 bekleyebilir. Bir Ba\u015fakla \xe7al\u0131\u015fmak istiyorsan\u0131z, onu oldu\u011fu gibi kabul etmelisiniz. Ba\u015faktan yaralanmak ve onu kullanmak \xe7ok zordur. Ak\u0131ll\u0131 ve zeki bak\u0131\u015flar\u0131yla sizi hemen yakalar. Zaman ve enerji a\xe7\u0131s\u0131ndan c\xf6mert olmakla birlikte, a\u015f\u0131r\u0131 talepleri hemen sezer. Onun a\u011fz\u0131ndan \xf6vg\xfc dolu bir s\xf6z duyamazs\u0131n\u0131z. Kriz anlar\u0131nda so\u011fuk kanl\u0131 davran\u0131\u015flar\u0131yla sizi en iyi rahatlatan yine Ba\u015fakt\u0131r. Organizasyon i\u015flerde kesin ba\u015far\u0131 bekler ve ba\u015far\u0131s\u0131z kal\u0131rsan\u0131z su\xe7lamaya haz\u0131rd\u0131r.","Yarat\u0131c\u0131 ve artistik bir benli\u011fi vard\u0131r. Ona yak\u0131\u015fan i\u015f fazla zor olmamal\u0131d\u0131r.Neyin nerede uyum sa\u011flayaca\u011f\u0131n\u0131 ondan ba\u015fka hi\xe7 kimse bilemez. Huzursuz ve kaba ortamlarda \xe7al\u0131\u015fmaktan ho\u015flanmazlar. Bir Terazi\u2019nin ofisi zevkle d\xf6\u015fenmi\u015f, g\xfczel ki\u015fili\u011fini yans\u0131tan objelerle s\xfcslenmi\u015ftir. Masas\u0131nda daima taze \xe7i\xe7ekler olacakt\u0131r. Misafirlerini en kaliteli ikramlarla a\u011f\u0131rlayacakt\u0131r. \u0130yi bir Terazi\u2019nin yan\u0131nda \xe7al\u0131\u015fmak son derece keyif vericidir. \xc7ok mant\u0131kl\u0131d\u0131r. Olaylar\u0131 her a\xe7\u0131dan farkl\u0131 boyutlarda de\u011ferlendirir ve hemen karar vermez. Dedikodular onu ilgilendirmez ve sadece g\xfc\xe7l\xfc akl\u0131ndan yararlan\u0131r. \u0130li\u015fkilerinde, kar\u015f\u0131l\u0131kl\u0131 al\u0131\u015f veri\u015f \xe7ok \xf6nemlidir ve hedeflerine ula\u015fmak i\xe7in gerekli \xe7al\u0131\u015fma disiplinine sahiptir fakat d\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfc bu \xf6zelli\u011fini farkl\u0131 yans\u0131tabilir.","\xd6fkesi ve ya\u015fam enerjisi g\xf6zlerinde toplanm\u0131\u015ft\u0131r. Sessiz ve sakin yakla\u015f\u0131mlar\u0131 bile \xfcrk\xfct\xfcc\xfcd\xfcr. Her \u015feyi inceleyen bak\u0131\u015flar\u0131 ile sorunlar\u0131 \xe7\xf6zme konusunda son derece ba\u015far\u0131l\u0131d\u0131rlar. K\u0131skan\xe7l\u0131klar\u0131 \xe7o\u011fu zaman zararl\u0131d\u0131r. Kendileri de bu \xf6zelliklerini iyi bildikleri i\xe7in, s\xfcrekli denetleme ihtiyac\u0131n\u0131 duyarlar. Akrep birlikte \xe7al\u0131\u015f\u0131lmas\u0131 \xe7ok zor biridir. Ya\u015fant\u0131s\u0131na herkesi almazlar.Y\xf6netmeyi, y\xf6nlendirmeyi, problemleri radikal bir \u015fekilde \xe7\xf6zmeyi seven Akreplerin, \xf6fkeleriniz kontrol etmek i\xe7in olduk\xe7a zorland\u0131klar\u0131 bir ger\xe7ektir. Sadakati ve kal\u0131c\u0131l\u0131\u011f\u0131 tercih eder. Kaybetmekten nefret etse de, kendini yenileme konusunda son derece h\u0131zl\u0131d\u0131r. Yan\u0131p k\xfcl olan k\xfcllerinin aras\u0131ndan, b\xfcy\xfck bir g\xfc\xe7le aya\u011fa kalkar ve yoluna devam eder.Ya\u015fam\u0131n derin sorgulay\u0131c\u0131s\u0131 ve derin bir gezginidir.","Yeni i\u015f deneyimlerinde onlar\u0131 desteklemeli ve daima fikirlerini dinlemelisiniz. Bu \u015fekilde i\u015f ortam\u0131na daha motive bir \u015fekilde haz\u0131rl\u0131kl\u0131 geleceklerdir. Yay burcu insanlar\u0131 genel olarak geni\u015f \xe7evreye sahiplerdir. insanlarla olan ili\u015fkilerinde hep aktif ve d\u0131\u015fa d\xf6n\xfck olmaya \xf6zen g\xf6sterirler.","So\u011fukkanl\u0131d\u0131r. Yap\u0131lmas\u0131 gereken her \u015feyi, sorumluluklar\u0131n\u0131n bilincinde olarak yapar. \xc7al\u0131\u015f\u0131rken g\xf6z\xfc hi\xe7bir \u015fey g\xf6rmez. \u0130\u015f ortam\u0131nda insani ili\u015fkileri kuvvetlidir. Rekabet duygusu yo\u011fun oldu\u011fu i\xe7in sevilmeyen ki\u015fiyi oynayabilir. \u0130dareci ve lider vasf\u0131n\u0131 tam ta\u015f\u0131d\u0131\u011f\u0131 i\xe7in, organizasyonlar\u0131n vazge\xe7ilmez ismidir. Madde ile yak\u0131n ba\u011f\u0131 olan bu ki\u015finin ekonomi y\xf6n\xfc olduk\xe7a g\xfc\xe7l\xfcd\xfcr. Kaliteli bir ya\u015fam\u0131 sever. Dikkatli ve planl\u0131 bir \u015fekilde hedeflerine ad\u0131m ad\u0131m yakla\u015f\u0131r. \xc7evresinde ki\u015filerle olan mesafesini korur","Onunla \xe7al\u0131\u015fanlar, orijinal ve \xfcretken benli\u011fine sayg\u0131 duyarlar. Hayal g\xfcc\xfc geni\u015f ve fikirleri \xe7a\u011f\u0131n \xf6tesindedir. \xd6z\xfc s\xf6z\xfc do\u011frudur. Kendine \xf6zel stili olan, rasyonel ve entelekt\xfcel bir ki\u015fili\u011fi vard\u0131r. Onunla birlikteyken, asla ne d\xfc\u015f\xfcnd\xfc\u011f\xfcn\xfc anlaman\u0131z m\xfcmk\xfcn de\u011fildir. S\xfcrekli sizi ara\u015ft\u0131r\u0131r ve kendine ait bir tek ip ucu bile vermez. \u0130\u015f \xe7evresinde kendi fikirlerine ve de\u011fer yarg\u0131lar\u0131na g\xfcvenir. Payla\u015f\u0131mlar\u0131nda ne kadar samimi oldu\u011funu bazen anlaman\u0131z g\xfc\xe7le\u015febilir. \u0130\u015f yerinde radikal kararlar almas\u0131yla \xfcnl\xfcd\xfcr. K\xf6kten de\u011fi\u015fimle ya\u015fat\u0131r ve \xe7evresiniz hayrete d\xfc\u015f\xfcrebilir. Ona bask\u0131 yapmamal\u0131 ve size ayk\u0131r\u0131 gelse de fikirlerini ho\u015f g\xf6r\xfcyle kar\u015f\u0131lay\u0131n. Ne yapaca\u011f\u0131n\u0131 \xf6nceden haber vermeyen bu ki\u015fi ile ya\u015fanlar, de\u011fi\u015fimlere her an haz\u0131r olmal\u0131d\u0131rlar.","Bal\u0131klar sanat\xe7\u0131 ruhlu ki\u015filerdir ve ofis i\u015flerine uygun de\u011fildirler. \xc7evresinde herkesin yard\u0131m\u0131na ko\u015farken bile, hem kendisin, hem de \xe7evresinin akl\u0131n\u0131 kar\u0131\u015ft\u0131r\u0131r. S\xfcrekli kendini bir i\u015fe ait olmad\u0131\u011f\u0131 i\xe7in su\xe7lar, fakat asla ideal i\u015fini bulamaz. Bulundu\u011fu yerde pop\xfcler insanlar\u0131n yan\u0131nda olmak ister. S\u0131radan ki\u015filerle \xe7al\u0131\u015fmak istemez.Hayal d\xfcnyas\u0131nda ya\u015fad\u0131klar\u0131 i\xe7in, onlar\u0131n akl\u0131n\u0131 ba\u015f\u0131na getirecek arkada\u015flara gereksinim duyarlar.Bulundu\u011fu ofisin sakin olmas\u0131na \xf6zen g\xf6sterir, kalabal\u0131k ortamlarda dikkati da\u011f\u0131l\u0131r.\u0130leti\u015fim kurulam\u0131yorsa onu yaln\u0131z b\u0131rak\u0131n. \u0130htiyac\u0131 vard\u0131r ve gerekirse size o, ula\u015f\u0131r.Onun sorunlar\u0131n\u0131 dinlemeye kalk\u0131\u015fmay\u0131n ba\u015faramazs\u0131n\u0131z, akl\u0131n\u0131z daha da kar\u0131\u015f\u0131r. Olaylar\u0131 abartmas\u0131na izin verin.buna ihtiyac\u0131 vard\u0131r. Ger\xe7ek d\xfcnyadan ka\xe7arak, sanal ya\u015fam\u0131nda kendini daha g\xfcvenli hissedecektir, \xfcst\xfcne d\xfc\u015fmeyin."]),t.s)
